// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // Asegúrate de que el archivo de Navbar esté en la carpeta correcta
import Inicio from './pages/Inicio'; // Página de inicio
import Reservar from './pages/Reservar'; // Página de reservas
import Nosotros from './pages/Nosotros'; // Página "Nosotros"
import Contacto from './pages/Contacto'; // Página de contacto
import Login from './pages/Login'; // Página de login para el administrador

function App() {
  return (
    <Router>
      <Navbar /> {/* La barra de navegación se aplica globalmente */}

      <div className="container">
        <Routes>
          {/* Definimos las rutas de la aplicación */}
          <Route path="/" element={<Inicio />} /> {/* Página de inicio */}
          <Route path="/reservar" element={<Reservar />} /> {/* Página de reservas */}
          //Route path="/nosotros" element={<Nosotros />} /> {/* Página Nosotros */}
          <Route path="/contacto" element={<Contacto />} /> {/* Página de contacto */}
          <Route path="/login" element={<Login />} /> {/* Página de login para el administrador */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
